  return (
      <BrowserRouter>
          <Routes>
              <Route index element={<Home/>}></Route>
              <Route path="/home" element={<Home/>}></Route>
              <Route path="/login" element={<Login/>}></Route>


          </Routes>
      </BrowserRouter>
  );
}

export default App;
